import React, {Component} from 'react';
import {Col, Row} from 'reactstrap';

const people = [
  {
    name: "Naveen Kharwar",
    url: "url:(https://www.naveenkharwar.com/)",
    id: '1'
  },
]

class Credits extends Component{
  render() {
    return (
      <div>
        {
          people.map( person =>
            <div key={person.id}>
                <h1> {person.name} </h1>
                 <a href={person.url}>Policies</a>
            </div>
          )
        }
      </div>
    );
  }
}

export default Credits;
